export const validateApiResponse = (response) => {
    // Check if the response has a data property with results as an array
    if (!response || !response.data || !Array.isArray(response.data.results)) {
        return false; // Invalid response
    }

    // Validate the structure of the first item in results if it exists
    const firstResult = response.data.results[0];
    return firstResult && typeof firstResult.name === 'string';
};
